import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Alert, Platform, Pressable, StyleSheet, Text, Image, FlatList, View } from 'react-native';
import FlatListBasics from './Components/FlatList';

const STATUS_BAR_HEIGHT = Platform.select({ios:20, android:24});

const onClick = () => {
  alert("lol");
}

const ShoppingListScreen = ({navigation,route}) => {
  
    const data1 = [];
    const data = [
      {key: 'Makaroni', expDate: "1"},
      {key: 'Dan', expDate: "2"},
      {key: 'lalala', expDate: "2"},
      {key: 'Jackson', expDate: "3"},
      {key: 'James', expDate: "10"},
      {key: 'Joel', expDate: "10"},
      {key: 'John', expDate: "10"},
      {key: 'Jillian', expDate: "10"},
      {key: 'Jimmy', expDate: "10"},
    ];
    return (
        <View style={styles.container}>
            <View style={{ height: STATUS_BAR_HEIGHT}} />
        <View style={styles.topBarContainer}>
          <Text style={styles.titleStyle}>Recepti</Text>
        </View>
        <View style={styles.mainContainer}>
          <View style={styles.legendcontainer}>
              <View style={{flex:1,justifyContent:"center"}}>
              <Text style={styles.nameStyle}>Ime</Text>
            </View>
            <View style={{flex:1,justifyContent:"center",alignItems:"flex-end"}}>
              <Text style={styles.expStyle}>Ocena</Text>
            </View>
            </View>
            
          <View style={styles.listContainer}>{typeof data !== 'undefined' ?
              data.length != 0 ? <FlatList
          data={data}
            renderItem={({item}) =><Pressable style={{flexDirection:"row"}} onPress={onClick}><View style={styles.itemContainer}>
              <Text style={styles.item}>{item.key}</Text>
            </View>
            <View style={[styles.itemContainer,{justifyContent:"flex-end",flexDirection:'row'}]}>
              <Text style={[styles.item,{right:2,top:1}]}>{item.expDate}</Text> 
              <Image style={{width:20,height:20,alignSelf:'center', right:10}} source={require("./Icons/restaurant.png")}></Image>
            </View>
            </Pressable>}
          />
          : <Text style={styles.notifStyle}>Uh, oh Vaš seznam je prazen :(</Text> : <Text style={styles.notifStyle}>Uh, oh Vaš seznam je prazen :(</Text> }
      </View>
        </View>
        </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'transparent',
  },
  topBarContainer:{
      flex:1,
      backgroundColor:"transparent",
      justifyContent:"center",
      alignItems:"center",
      borderBottomWidth:1
 },
 pressableStyle:{
     flex:1,
    alignItems:"center",
    justifyContent:"center",
    borderColor:"gray",
    borderWidth:1,
 },

 mainContainer:{
    flex:8,
  },
  titleStyle: {
    fontSize: 22,
    textAlign:'center',
    bottom:15
  },listContainer: {
    flex: 8,
    alignContent:"flex-start",
    
   },
   itemContainer:{
     flex:1
   },
   item: {
     padding: 10,
     fontSize: 16,
     height: 44,
   },
   legendcontainer:{flex:1,flexDirection:"row",justifyContent:"center", borderBottomWidth:1},
   nameStyle:{
     fontSize:20,paddingLeft:10
   },
   expStyle:{
    fontSize:20,paddingRight:10
  },
  notifStyle:{
    fontSize:16,
    top:30,
    alignSelf:'center'
  }
});
export default ShoppingListScreen
